DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `update_off_type` (IN `id_owner_param` INT)   BEGIN
    UPDATE members
    SET off_type = 
    CASE 
        WHEN EXISTS (SELECT * FROM member_to_free WHERE identity_mem = members.identity_mem AND sessions > session_done) THEN 'free'
        WHEN EXISTS (SELECT * FROM member_to_offers WHERE identity_mem = members.identity_mem AND end_date > CURDATE() AND member_to_offers.session_done < (SELECT num_session_off FROM offers WHERE id_off = (SELECT id_off FROM member_to_offers WHERE identity_mem = members.identity_mem AND end_date > CURDATE() LIMIT 1))) THEN (SELECT name_off FROM offers WHERE id_off = (SELECT id_off FROM member_to_offers WHERE identity_mem = members.identity_mem AND end_date > CURDATE() LIMIT 1))
        ELSE 'none'
    END
    WHERE members.id_owner = id_owner_param;
END$$

